#this file contains the train/test split of SAT problems
#we ran the exact model counter dsharp with a timeout of 5k seconds on all problems from 
#"Bird: Engineering an efficient CNF-XOR sat solver and its applications to approximate model counting"
#with sampling sets and minimal independent support variable sets removed.
#dsharp finished 928 problems within this timeout of 5k seconds.
#We then discarded problems that had any clauses containing more than 5 variables, leaving us with
#878 problems. Of these problems , we split problems by name into the categories
# "blasted_problems", "brp_problems", "crowds_problems", "egl_problems", "herman_problems", "hash_problems", 
# "leader_sync_problems", "log_problems", "min_problems", "modexp_problems", "nand_problems", "or_100_problems", 
# "or_50_problems", "or_60_problems", "or_70_problems", "prod_problems", "s_problems", "tire_problems", 
# "number_letter_number_problems", "sk_problems", "problem_4step", "problems_50", "problems_75", and "problems_90"
# for all categories that had > 10 solved problems, we randomly split roughly 30% into the test set
# and roughly 70% into the training set.

